window.bookSummaryJSON = "<p><b>The war they'd all feared</b></p> <p>The star cluster's super-powers tried to make peace last. Truly, they did. But everyone knew war between Ascendant Horizon and the Coalition of Giants was inevitable.</p> <p>Saddled with an alliance that seems to struggle with the basics of space warfare, Captain Thatcher must fall back on his tactical prowess—along with the steadfastness of the crews under his command—just to keep his people alive.</p> <p>But an enemy lurks around every corner, and there is dissension even in Thatcher's fleet. What's more, he knows there are only two ways this war can end.</p> <p>In victory, or in total defeat.</p> <p><b><i>Spacers, Part 4</i></b><b> contains</b><b><i> Book 7: Fleet Action</i></b><b> through to the end of </b><b><i>Book 8: Dawn War</i></b><b>.</b></p>"; 
